llen und Swisscom ein. Der Vorwurf: Marktmissbrauch. Weko-Angaben zufolge gingen in den vergangenen Monaten noch weitere Meldungen zu Kooperationen zwischen Elektrizit\xE4tsversorgern und der Swisscom bei der Wettbewerbsbeh\xF6rde ein. Als erste Stadt habe St. Gallen einzelne Klauseln ihres Kooperationsvertrages im Rahmen eines Widerspruchsverfahrens zur \xDCberpr\xFCfung gemeldet, weshalb diese Kooperation auch als erste beurteilt werde. Bei diesen Vertragsklauseln sehe die Weko teilweise 'wettbewerbsrechtliche Probleme', weshalb sie jetzt eine Vorabkl\xE4rung er\xF6ffnet habe. Die ausgehandelten Vertragsklauseln, so die Weko, 'k\xF6nnten gem\xE4\xDF einer ersten Einsch\xE4tzung den Wettbewerb nachhaltig beschr\xE4nken und langfristig zu einer Monopolisierung der Glasfasernetzinfrastruktur f\xFChren'. Ins Visier nehmen die Wettbewerbsh\xFCter auch die geplante Gr\xFCndung eines Gemeinschaftsunternehmens zwischen der Swisscom und dem Energieversorger Groupe E zum Aufbau und Betrieb einer gemeinsamen Glasfaserinfrastruktur im Kanton Freiburg. Hier best\xFCnden Anhaltspunkte, dass das Gemeinschaftsunternehmen 'eine marktbeherrschende Stellung begr\xFCndet oder verst\xE4rkt'. (pmz) ",iyc='Dimension',gkc='Dimension [height=',yuc='DirectionalTextHelper',Buc='DockLayoutPanel',Cuc='DockLayoutPanel$Direction',Duc='DockLayoutPanel$Direction;',Guc='DockLayoutPanel$DockAnimateCommand',Euc='DockLayoutPanel$LayoutData',Lqc='DomEvent',Qqc='DomEvent$Type',Swc='Double',ihc='EAST',ibc='EEE, d MMM yyyy HH:mm:ss Z',_mc='EEE. dd MMM. yyyy HH:mm:ss',icc='EEEE MMMM d',Jcc='EEEE, MMMM d',Fcc='EEEE, MMMM d, y',ecc='EEEE, y MMMM dd',P8b='EM',Rec='EMPTY',Wec='ENABLED',bdc='END',R8b='EX',gtc='ElementMapperImpl',htc='ElementMapperImpl$FreeNode',Ecc='English',Ypc='Enum',vcc='Etc/GMT',xcc='Etc/GMT+',wcc='Etc/GMT-',e9b='Event type',Yvc='Event$NativePreviewEvent',brc='EventBus',npc='EventObject',spc='Exception',Qfc='Expecting version 6 from server, got ',_9b='F',ilc='F8834F07517EF3B7D02B9E845E5E1B
